import React from 'react';
import '../css/style.css';
import Header from '../components/Header';
import Footer from '../components/Footer';
import PolicyContent from '../components/PolicyContent';


export default function Policy() {
    return (
        <>
            <Header />
            <PolicyContent />
            <Footer />
        </>
    )
}
